import Input from '../../general/Input';
 class Addproduct extends Component {
  render() {
    return (
      <div className='from-group'>
        <Input
        type="text"
        placeholder="name of product"
        name=""
        value={value}
        onChange={onChange}
        style={style}
      />
      </div>
    )
  }
}
export default Addproduct;
